import MarkdownIt from 'markdown-it';
import { htmlToText } from 'html-to-text';
import striptags from 'striptags';

let a = '<p><strong>## 三步快速编译</strong></p><p><br></p><p><strong>### 1. 编译 Go 静态库</strong></p><p>```bash</p><p>go build -buildmode=c-archive -o libgoLib.a main.go</p><p>```</p><p><br></p><p><strong>### 2. 生成 JNI 头文件并编译动态库</strong></p><p>```bash</p><p># 生成 JNI 头文件</p><p>javac -h . main.java</p><p><br></p><p># 编译动态库（macOS）</p><p>JAVA_HOME=$(/usr/libexec/java_home)</p><p>gcc -I"$JAVA_HOME/include" -I"$JAVA_HOME/include/darwin" \</p><p>    -shared -fPIC -o libgoLib.dylib bridge.c libgoLib.a</p><p>```</p><p><br></p><p><strong>### 3. 运行</strong></p><p>```bash</p><p>java -Djava.library.path=. main</p><p>```</p><p><br></p><p><strong>## 文件说明</strong></p><p><br></p><p>| 文件 | 说明 | 生成方式 |</p><p>|------|------|----------|</p><p>| `main.go` | Go 源代码 | 手动编写 |</p><p>| `main.java` | Java 源代码 | 手动编写 |</p><p>| `bridge.c` | JNI 桥接层 | 手动编写 |</p><p>| `libgoLib.a` | Go 静态库 | `go build -buildmode=c-archive` |</p><p>| `libgoLib.h` | Go 导出头文件 | 自动生成 |</p><p>| `main.h` | JNI 头文件 | `javac -h .` |</p><p>| `libgoLib.dylib` | 最终动态库 | `gcc` 编译 |</p><p><br></p><p><strong>## 关键点</strong></p><p><br></p><p>1. <strong>**Go 函数导出**</strong>：使用 `//export 函数名`</p><p>2. <strong>**JNI 函数命名**</strong>：`Java_类名_方法名`</p><p>3. <strong>**库加载**</strong>：`System.loadLibrary("goLib")` 或 `-Djava.library.path=.`</p><p><br></p><p><br></p>'

const md = new MarkdownIt();

const html = md.render(a);

const text = htmlToText(html, {
    wordwrap: 130,              // 可选：换行宽度
    ignoreImage: true,          // 忽略图片
    ignoreHref: true,           // 不保留链接文字
    preserveNewlines: true,     // 保留换行
  });

// console.log('text',text);
// console.log('a',a);
const b = striptags(a); // 简单粗暴去标签，但脚本内容可能保留
console.log('b',b);


